import React from 'react'
import NavBar from '../Components/NavBar'
import Footer from '../Components/Footer'
import UserProfile from '../Components/UserProfile'
import { Redirect, withRouter } from 'react-router-dom';
import $ from 'jquery';
Window.$ = $;

export const ViewProfile = (match) => {
  var username = "";
  if (this.props.LoggedIn && this.props.User.admin) {
    return (
      <div className="MainPage">
        <NavBar />
        <p><input id="usertext" type="text" name="username" />
          <button onClick={() => { username = $("#usertext").val(); this.forceUpdate(); }} /></p>
        <UserProfile username={this.username === "" ? this.User.username : this.username} />
        <Footer />
      </div>
    );
  } else {
    return (<Redirect to="/Login" />);
  }
}
